query FOLDERS($where: CategoryWhereInput!) {
    categories(where: $where) {
      id
      title
      childrenCount
      children {
        id
        title
      }
      parent {
        id
        title
      }
    }
  }

  query NOTES($where: NoteWhereInput!) {
  notes(where: $where) {
    message
    createdAt
    id
    createdBy {
      fullname
      id
      role
    }
  }
  authenticatedItem {
    ... on User {
      id
    }
  }      
}

mutation NOTES_CREATE($data: NoteCreateInput!) {
  createNote(data: $data) {
    id
    message
    createdAt
    createdBy {
      id
      fullname
      role
    }
  }
}

mutation NOTE_UPDATE($data: NoteUpdateInput!, $where: NoteWhereUniqueInput!) {
  updateNote(data: $data, where: $where) {
    id
    message
    createdAt
    createdBy {
      id
      fullname
      role
    }
  }
}

  query DESCRIPTIONS_OF_APPROVAL_QUERY($id: ID!) { 
  descriptions(where: {approvals:{id: {equals: $id}}}) {
    id
    title
  }
}

  query APPROVALS_Q {
    approvals {
      id
      title
    } 
}

  query DESCRIPTION_APPROVAL_Q($id: ID!) {
    description(where: {id: $id}) {
      id
      title
      approvals {
        id
        title
      }
    } 
}

query FOLDERPATH($id: ID!) {
  category(where: { id: $id }) {
    id
    title
    childrenCount
    children {
      id
      title
    }
    parent {
      id
      title
    }
    designs {
      id
      title
      createdAt
    }
  }
}

mutation CREATEFOLDER($data: CategoryCreateInput!) {
  createCategory(data: $data) {
    id
  }
}

mutation REMOVEFOLDER($id: ID!) {
  deleteCategory(where: { id: $id }) {
    id
  }
}

